import React, { Component , useContext} from 'react';
import { useAuthContext } from '../../hooks/useAuthContext'


const Home = () => {

  const {user} = useAuthContext()
  console.log(user)

  return (
    <div>
      <h1>Hello Wellcome, {user.username}</h1>
    </div>
  )
}

export default Home
